import React from 'react';
import {
    BookstoreServiceConsumer
} from '../bookstore-service-context'

const withBoostoreService = () => (Wrapped) => {
    return (props) => {
        <BookstoreServiceConsumer>
            {
                (bookstoreService) => {
                    <Wrapped { ... props }  
                    bookstoreService={bookstoreService}/>
                }
            }
            <Wrapped />
        </BookstoreServiceConsumer>
    }
}

export default withBoostoreService;
